import React from 'react';
import './NavBar.css';

const NavBar = (props) => {
  const navItems = [
    {
      text: "HOME",
      loggedInOnly: false,
      path: "#"
    },
    {
      text: "ORDER",
      loggedInOnly: false,
      path: "#"
    }

  ];

  return (
    <nav className="nav-bar">
      <ul className="nav-links">
        <li className="nav-item">
            HOME         
        </li>
        <li>
            ORDER
        </li>
        <li>
            CART
        </li>
      </ul>
    </nav>
  );

  /*
    {auth.isLoggedIn && (
      <li>
        <NavLink to="#">ACCOUNT</NavLink>
      </li>
    )}
    {!auth.isLoggedIn && (
      <li>
        <NavLink to="#">LOGIN</NavLink>
      </li>
    )}
  */    
};

export default NavBar;
